// App.js

import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom'; // Removed unnecessary import

import Navbar from './Components/Navbar';
import Home from './Components/Home'; // Changed import statement to remove curly braces
import About from './Components/About';

function App() {
  return (
    <>
      <BrowserRouter>
        <Navbar />
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route exact path="/about">
            <About />
          </Route>
        </Switch>
      </BrowserRouter>
    </>
  );
}

export default App;
